import React from 'react'
import axios from 'axios';
import { NavLink, useNavigate } from 'react-router-dom';

const Home = () => {

    const navigate = useNavigate();

    const logout = async (e) => {
        e.preventDefault()
        const token = localStorage.getItem("token");

        try {
            const resp = await axios.post(
                "https://login-api.web2rise.in/api/logout",
                {
                    headers: {
                        Authorization: token,
                        "Content-Type": "application/json",
                    },
                }
            );

            if (resp) {
                navigate('/Login')
            }

        } catch (error) {
            console.error(error);
        }
    }

    return (
        <>
            <div className='main_div'>
                <ul className='child_div'>
                    <NavLink className='create_user' to="/CreateUser"><li className='create_user1'>Create User</li></NavLink>
                    <NavLink className='create_user' to="/User"><li className='create_user2'>User</li></NavLink>
                    <NavLink className='create_user' to="/" onClick={logout} ><li className='create_user2'>Logout</li></NavLink>
                </ul>
            </div>
        </>
    )
}

export default Home
